import clock from '../Image/clock.png'
import location from '../Image/placeholder.png'
import pencil from '../Image/pencil-edit.png'
import tag from '../Image/tag.png'
import AppFooter from '../AppFooter';
import Account from '../Member/Account';
import TopArticle from '../partbody/TopArticle';
import Sugestion from '../partbody/Suggestion';

import AppNav from '../AppNav';


export default class Event extends Component {

  render() {
    return (
      <div style={{backgroundColor:'#ececec'}}>
        <AppNav/>

        <Container style={{width: '900px',
            height: 'auto',
            backgroundColor: '#ffffff', 
            marginBottom:'40px', marginTop:'50p'}}>
        <Card>

        </Card>
<CardImg style={{ width: '776px',  height: '435.8px', margin:'auto'}} src="
      https://scontent.fcgk8-2.fna.fbcdn.net/v/t1.0-9/37228699_10156511912949419_5427734426052198400_n.jpg?_nc_cat=106&_nc_eui2=AeFbW0UNjyUU6wUYr2IRN9OeP8hreReeKw5JhLn4zpkqOk1EoX7p-oyHW8DTrHt5IrPnY0tK6xlY0Q6fIY6iv9XgAzUKHS8I46Du69aZ0qCGvQ&_nc_ht=scontent.fcgk8-2.fna&oh=c180ed12f4d6e241827c9bed4879df13&oe=5D034823
      "  ></CardImg>
        </Container>



      <AppFooter/>
      </div>
    )
  }
}
